		"text": "\"회사 측은 사건 발생 후 징계위원회를 열고 같은달 18일부로 A씨를 해고했다. 회사 측은 \"남자 직원이 몰카를 여자화장실에 설치했지만 바로 발견해 미수에 그쳤다\"며 \"피해자는 없다\"고 강조했다.\"",
